INSERT INTO `document` (`id_document`,`code_document_type`,`date_creation`,`date_modification`,`title`,`id_space`,`id_state`,`xml_working_content`,`xml_validated_content`,`summary`,`comment`,`date_validity_begin`,`date_validity_end`,`xml_metadata`,`id_creator`,`accept_site_comments`,`is_moderated_comment`,`is_email_notified_comment`) VALUES 
 (56,'article','2006-10-11 09:41:21','2006-10-04 10:09:25','lutecev2',15,5,'<article>\r\n<document-title>lutecev2</document-title>\r\n<document-summary>tret</document-summary>\r\n<article-url>http://fr.lutece.paris.fr</article-url>\r\n<article-attachment><file-resource>\r\n<resource-document-id>56</resource-document-id>\r\n<resource-attribute-id>11</resource-attribute-id>\r\n<resource-content-type>application/octet-stream</resource-content-type>\r\n</file-resource>\r\n</article-attachment>\r\n<article-body><![CDATA[Bienvenue sur ce site démonstration. Il s\'agit d\'une pré-version de Lutèce v2.0. Ce n\'est donc pas la version définitive, ni même une version béta. Elle ne doit en aucun cas être utilisée en production. La version finale dont le nom de code est \"Oyapok\" est prévue au mois d\'octobre 2006. Les premières versions béta seront disponibles à partir de cet été. Voici les nouveautés de cette version majeure : - Une nouvelle gestion documentaire basée sur un modèle de document entièrement dynamique à l\'instar d\'outils tels que ezPublish. Les documents sont gérés dans des espaces à la manière d\'outils tels que Alfresco. Un workflow et un moteur de règles permettent de définir très simplement différents scénarios de circuits de validation et de publication. Cette gestion permet d\'intégrer dans le même modèle plusieurs plugins de la version 1.0 : article, bibliothèque multimédia, fichiers en téléchargement, acteurs locaux... - Une nouvelle gestion centrale des droits/rôles/permissions permet de contrôler l\'accès à l\'ensemble des ressources du portail. Basée sur le modèle RBAC (Role Based Access Control), elle permet de répartir l\'administration du site de manière cloisonnée sur plusieurs équipes. Les ressources concernées par ce dispositif sont aussi celles du noyau (pages, portlet, ...) que celles des plugins (documents, agenda, fils RSS, ...). L\'une des premières applications de cette fonctionnalités est la réalisation d\'espaces collaboratifs sur la même instance de Lutèce dont la gestion pourra se faire de manière entièrement étanche entre espaces. - L\'authentification du backoffice est désormais modulaire pour permettre un contrôle à partir d\'un annuaire LDAP ou tout autre dispositif externe. Au niveau technique, cette version de Lutèce s\'appuie sur de nouvelles briques Open Source éprouvées : - Le moteur de templates Freemarker a été intégré. Il permet de simplifier l\'écriture des templates et apporte de nombreuses fonctionnalités puissantes pour la réalisation des fonctions d\'administration du backoffice. A cette occasion, le code des templates a été épuré en se basant exclusivement sur des styles CSS2 et sur la syntaxe XHTML. La taille des templates entre la v2.0 et la v1.0 a été réduite de 40% tout en offrant plus de confort pour l\'utilisateur. Le code final sera 100% compatible XHTML. Freemarker\'s Logo - Le gestion de cache EHCACHE a également été intégrée. Elle permet de disposer d\'un cache persistent et distribué. Le cache volatile de la version 1.0 pouvait constituer un problème au redémarrage d\'un site ayant plusieurs milliers de pages et un fort de traffic comme Paris.fr. EHCACHE\'s Logo Enfin dernière nouveauté et non des moindres, la version 2.0 gère entièrement l\'internationalisation par le biais des mécanismes standards Java (ResourceBundle, MessageFormat, ...). Par défaut, les languages anglais et français seront disponibles et maintenus par l\'équipe de Lutèce, mais d\'autres pourront être facilement proposés par d\'autres contributeurs. Cette nouvelle version de Lutèce constitue une évolution majeure de l\'outil. Elle intègre 5 années d\'expérience sur l\'exploitation de plus d\'une centaine d\'instances de Lutèce utilisées en interne et plus 3 ans de travail sur la refonte techique de Paris.fr. Son nouveau socle technique, à la fois simple, robuste et éprouvé, respecte les derniers standards tout en assurant une prise en main et une maintenabilité à la portée de tous. L\'équipe de Lutèce est donc très fière de vous présenter cette pré-version 2.0 et espère qu\'elle vous séduira dans l\'attente de la version finale d\'Oyapok. ]]></article-body>\r\n</article>\r\n','<article>\r\n<article-title>Lutève v2 en version alpha !</article-title>\r\n<article-url>http://fr.lutece.paris.fr</article-url>\r\n<article-summary>Sortie de la pré-version de Lutèce v2</article-summary>\r\n<article-attachment><file-resource>\r\n<resource-document-id>56</resource-document-id>\r\n<resource-attribute-id>11</resource-attribute-id>\r\n<resource-content-type>application/octet-stream</resource-content-type>\r\n</file-resource>\r\n</article-attachment>\r\n<article-body><![CDATA[Bienvenue sur ce site démonstration. Il s\'agit d\'une pré-version de Lutèce v2.0. Ce n\'est donc pas la version définitive, ni même une version béta. Elle ne doit en aucun cas être utilisée en production. La version finale dont le nom de code est \"Oyapok\" est prévue au mois d\'octobre 2006. Les premières versions béta seront disponibles à partir de cet été. Voici les nouveautés de cette version majeure : - Une nouvelle gestion documentaire basée sur un modèle de document entièrement dynamique à l\'instar d\'outils tels que ezPublish. Les documents sont gérés dans des espaces à la manière d\'outils tels que Alfresco. Un workflow et un moteur de règles permettent de définir très simplement différents scénarios de circuits de validation et de publication. Cette gestion permet d\'intégrer dans le même modèle plusieurs plugins de la version 1.0 : article, bibliothèque multimédia, fichiers en téléchargement, acteurs locaux... - Une nouvelle gestion centrale des droits/rôles/permissions permet de contrôler l\'accès à l\'ensemble des ressources du portail. Basée sur le modèle RBAC (Role Based Access Control), elle permet de répartir l\'administration du site de manière cloisonnée sur plusieurs équipes. Les ressources concernées par ce dispositif sont aussi celles du noyau (pages, portlet, ...) que celles des plugins (documents, agenda, fils RSS, ...). L\'une des premières applications de cette fonctionnalités est la réalisation d\'espaces collaboratifs sur la même instance de Lutèce dont la gestion pourra se faire de manière entièrement étanche entre espaces. - L\'authentification du backoffice est désormais modulaire pour permettre un contrôle à partir d\'un annuaire LDAP ou tout autre dispositif externe. Au niveau technique, cette version de Lutèce s\'appuie sur de nouvelles briques Open Source éprouvées : - Le moteur de templates Freemarker a été intégré. Il permet de simplifier l\'écriture des templates et apporte de nombreuses fonctionnalités puissantes pour la réalisation des fonctions d\'administration du backoffice. A cette occasion, le code des templates a été épuré en se basant exclusivement sur des styles CSS2 et sur la syntaxe XHTML. La taille des templates entre la v2.0 et la v1.0 a été réduite de 40% tout en offrant plus de confort pour l\'utilisateur. Le code final sera 100% compatible XHTML. Freemarker\'s Logo - Le gestion de cache EHCACHE a également été intégrée. Elle permet de disposer d\'un cache persistent et distribué. Le cache volatile de la version 1.0 pouvait constituer un problème au redémarrage d\'un site ayant plusieurs milliers de pages et un fort de traffic comme Paris.fr. EHCACHE\'s Logo Enfin dernière nouveauté et non des moindres, la version 2.0 gère entièrement l\'internationalisation par le biais des mécanismes standards Java (ResourceBundle, MessageFormat, ...). Par défaut, les languages anglais et français seront disponibles et maintenus par l\'équipe de Lutèce, mais d\'autres pourront être facilement proposés par d\'autres contributeurs. Cette nouvelle version de Lutèce constitue une évolution majeure de l\'outil. Elle intègre 5 années d\'expérience sur l\'exploitation de plus d\'une centaine d\'instances de Lutèce utilisées en interne et plus 3 ans de travail sur la refonte techique de Paris.fr. Son nouveau socle technique, à la fois simple, robuste et éprouvé, respecte les derniers standards tout en assurant une prise en main et une maintenabilité à la portée de tous. L\'équipe de Lutèce est donc très fière de vous présenter cette pré-version 2.0 et espère qu\'elle vous séduira dans l\'attente de la version finale d\'Oyapok. ]]></article-body>\r\n<article-tarif>FREE</article-tarif>\r\n<article-code_postal>75012</article-code_postal>\r\n</article>\r\n','tret','',NULL,NULL,'<metadata>\r\n<creator>Mairie de Paris</creator>\r\n<subject>lutece;portal;xml;java</subject>\r\n<publisher>Mairie de Paris</publisher>\r\n<format>text/html</format>\r\n<language>fr</language>\r\n<rights>Copyrights (c) Mairie de Paris</rights>\r\n</metadata>\r\n',0,0,0,0),
 (58,'article','2006-10-11 09:41:21','2007-03-15 13:59:49','Lutèce v2.0 - Oyapok',4,3,'<article>\r\n<document-title>Lutèce v2.0 - Oyapok</document-title>\r\n<document-summary>Lutèce v2.0 - Oyapok</document-summary>\r\n<article-url>http://</article-url>\r\n<article-attachment><file-resource>\r\n<resource-document-id>58</resource-document-id>\r\n<resource-attribute-id>11</resource-attribute-id>\r\n<resource-content-type>application/octet-stream</resource-content-type>\r\n</file-resource>\r\n</article-attachment>\r\n<article-body><![CDATA[La version 2.0 de Lutèce intègre les nouveautés suivantes :\r\n<br />\r\n<br />\r\n<p>- Une nouvelle gestion documentaire basée sur un <strong>modèle de document entièrement dynamique</strong> à l\'instar d\'outils tels que <em>ezPublish</em>. Les documents sont gérés dans des espaces à la manière d\'outils tels que <em>Alfresco</em>. Un workflow et un moteur de règles permettent de définir très simplement différents scénarios de circuits de validation et de publication. Cette gestion permet d\'intégrer dans le même modèle plusieurs plugins de la version 1.0 : article, bibliothèque multimédia, fichiers en téléchargement, acteurs locaux...\r\n  <br />\r\n</p>\r\n<p>- Une nouvelle <strong>gestion centrale des droits/rôles/permissions</strong> permet de contrôler l\'accès à l\'ensemble des ressources du portail. Basée sur le modèle RBAC (Role Based Access Control), elle permet de répartir l\'administration du site de manière cloisonnée sur plusieurs équipes. Les ressources concernées par ce dispositif sont aussi celles du noyau (pages, portlet, ...) que celles des plugins (documents, agenda, fils RSS, ...). L\'une des premières applications de cette fonctionnalités est la réalisation d\'espaces collaboratifs sur la même instance de Lutèce dont la gestion pourra se faire de manière entièrement étanche entre espaces.\r\n</p>\r\n<p>- L\'authentification du backoffice est désormais modulaire pour permettre un contrôle à partir d\'un annuaire LDAP ou tout autre dispositif externe.\r\n</p>\r\n<p>Au niveau technique, cette version de Lutèce s\'appuie sur de nouvelles briques Open Source éprouvées :\r\n</p>\r\n<p>- Le moteur de templates <strong>Freemarker</strong> a été intégré. Il permet de simplifier l\'écriture des templates et apporte de nombreuses fonctionnalités puissantes pour la réalisation des fonctions d\'administration du backoffice. A cette occasion, le code des templates a été épuré en se basant exclusivement sur des styles CSS2 et sur la syntaxe XHTML. La taille des templates entre la v2.0 et la v1.0 a été réduite de 40% tout en offrant plus de confort pour l\'utilisateur. Le <strong>code final sera 100% compatible XHTML</strong>.\r\n</p>\r\n<p align=\"center\"><a href=\"http://freemarker.org/\">\r\n  <img src=\"http://fr.lutece.paris.fr/fr/images/local/data/library/freemarker.png\" alt=\"freemarker\" align=\"bottom\" border=\"0\" />\r\n  <br /> </a>\r\n</p>\r\n<p>- La <strong>gestion de cache EHCACHE</strong> a également été intégrée. Elle permet de disposer d\'un cache persistent et distribué. Le cache volatile de la version 1.0 pouvait constituer un problème au redémarrage d\'un site ayant plusieurs milliers de pages et un fort de traffic comme Paris.fr.\r\n</p>\r\n<p align=\"center\"><a href=\"http://ehcache.sourceforge.net/\">\r\n  <img src=\"http://fr.lutece.paris.fr/fr/images/local/data/library/ehcache.gif\" alt=\"ehcache\" align=\"bottom\" border=\"0\" /></a>\r\n</p>\r\n<p>- Intégration de <strong>Spring</strong> pour permettre notamment l\'injection des classes DAO de l\'application : possibilité de substituer les classes d\'accès aux données par de nouvelles en cas d\'utilisation d\'une base de données autre que Mysql\r\n</p>\r\n<p align=\"center\"><a target=\"_blank\" href=\"http://www.springframework.org/\">\r\n  <img src=\"http://fr.lutece.paris.fr/fr/images/local/data/library/spring2.png\" alt=\"spring\" align=\"bottom\" border=\"0\" /></a>\r\n</p> Enfin dernière nouveauté et non des moindres, la version 2.0 gère entièrement l\'<strong>internationalisation</strong> par le biais des mécanismes standards Java (ResourceBundle, MessageFormat, ...). Par défaut, les languages anglais et français seront disponibles et maintenus par l\'équipe de Lutèce, mais d\'autres pourront être facilement proposés par d\'autres contributeurs (gestion de l\'encoding UTF-8). Cette nouvelle version de Lutèce constitue une évolution majeure de l\'outil. Elle intègre 5 années d\'expérience sur l\'exploitation de plus d\'une centaine d\'instances de Lutèce utilisées en interne et plus 3 ans de travail sur la refonte techique de Paris.fr. Son nouveau socle technique, à la fois simple, robuste et éprouvé, respecte les derniers standards tout en assurant une prise en main et une maintenabilité à la portée de tous.&nbsp; ]]></article-body>\r\n</article>\r\n','<article>\r\n<document-title>Lutèce v2.0 - Oyapok</document-title>\r\n<document-summary>Lutèce v2.0 - Oyapok</document-summary>\r\n<article-url>http://</article-url>\r\n<article-attachment><file-resource>\r\n<resource-document-id>58</resource-document-id>\r\n<resource-attribute-id>11</resource-attribute-id>\r\n<resource-content-type>application/octet-stream</resource-content-type>\r\n</file-resource>\r\n</article-attachment>\r\n<article-body><![CDATA[La version 2.0 de Lutèce intègre les nouveautés suivantes :\r\n<br />\r\n<br />\r\n<p>- Une nouvelle gestion documentaire basée sur un <strong>modèle de document entièrement dynamique</strong> à l\'instar d\'outils tels que <em>ezPublish</em>. Les documents sont gérés dans des espaces à la manière d\'outils tels que <em>Alfresco</em>. Un workflow et un moteur de règles permettent de définir très simplement différents scénarios de circuits de validation et de publication. Cette gestion permet d\'intégrer dans le même modèle plusieurs plugins de la version 1.0 : article, bibliothèque multimédia, fichiers en téléchargement, acteurs locaux...\r\n  <br />\r\n</p>\r\n<p>- Une nouvelle <strong>gestion centrale des droits/rôles/permissions</strong> permet de contrôler l\'accès à l\'ensemble des ressources du portail. Basée sur le modèle RBAC (Role Based Access Control), elle permet de répartir l\'administration du site de manière cloisonnée sur plusieurs équipes. Les ressources concernées par ce dispositif sont aussi celles du noyau (pages, portlet, ...) que celles des plugins (documents, agenda, fils RSS, ...). L\'une des premières applications de cette fonctionnalités est la réalisation d\'espaces collaboratifs sur la même instance de Lutèce dont la gestion pourra se faire de manière entièrement étanche entre espaces.\r\n</p>\r\n<p>- L\'authentification du backoffice est désormais modulaire pour permettre un contrôle à partir d\'un annuaire LDAP ou tout autre dispositif externe.\r\n</p>\r\n<p>Au niveau technique, cette version de Lutèce s\'appuie sur de nouvelles briques Open Source éprouvées :\r\n</p>\r\n<p>- Le moteur de templates <strong>Freemarker</strong> a été intégré. Il permet de simplifier l\'écriture des templates et apporte de nombreuses fonctionnalités puissantes pour la réalisation des fonctions d\'administration du backoffice. A cette occasion, le code des templates a été épuré en se basant exclusivement sur des styles CSS2 et sur la syntaxe XHTML. La taille des templates entre la v2.0 et la v1.0 a été réduite de 40% tout en offrant plus de confort pour l\'utilisateur. Le <strong>code final sera 100% compatible XHTML</strong>.\r\n</p>\r\n<p align=\"center\"><a href=\"http://freemarker.org/\">\r\n  <img src=\"http://fr.lutece.paris.fr/fr/images/local/data/library/freemarker.png\" alt=\"freemarker\" align=\"bottom\" border=\"0\" />\r\n  <br /> </a>\r\n</p>\r\n<p>- La <strong>gestion de cache EHCACHE</strong> a également été intégrée. Elle permet de disposer d\'un cache persistent et distribué. Le cache volatile de la version 1.0 pouvait constituer un problème au redémarrage d\'un site ayant plusieurs milliers de pages et un fort de traffic comme Paris.fr.\r\n</p>\r\n<p align=\"center\"><a href=\"http://ehcache.sourceforge.net/\">\r\n  <img src=\"http://fr.lutece.paris.fr/fr/images/local/data/library/ehcache.gif\" alt=\"ehcache\" align=\"bottom\" border=\"0\" /></a>\r\n</p>\r\n<p>- Intégration de <strong>Spring</strong> pour permettre notamment l\'injection des classes DAO de l\'application : possibilité de substituer les classes d\'accès aux données par de nouvelles en cas d\'utilisation d\'une base de données autre que Mysql\r\n</p>\r\n<p align=\"center\"><a target=\"_blank\" href=\"http://www.springframework.org/\">\r\n  <img src=\"http://fr.lutece.paris.fr/fr/images/local/data/library/spring2.png\" alt=\"spring\" align=\"bottom\" border=\"0\" /></a>\r\n</p> Enfin dernière nouveauté et non des moindres, la version 2.0 gère entièrement l\'<strong>internationalisation</strong> par le biais des mécanismes standards Java (ResourceBundle, MessageFormat, ...). Par défaut, les languages anglais et français seront disponibles et maintenus par l\'équipe de Lutèce, mais d\'autres pourront être facilement proposés par d\'autres contributeurs (gestion de l\'encoding UTF-8). Cette nouvelle version de Lutèce constitue une évolution majeure de l\'outil. Elle intègre 5 années d\'expérience sur l\'exploitation de plus d\'une centaine d\'instances de Lutèce utilisées en interne et plus 3 ans de travail sur la refonte techique de Paris.fr. Son nouveau socle technique, à la fois simple, robuste et éprouvé, respecte les derniers standards tout en assurant une prise en main et une maintenabilité à la portée de tous.&nbsp; ]]></article-body>\r\n</article>\r\n','Lutèce v2.0 - Oyapok','Prioritaire !',NULL,NULL,'<metadata>\r\n<title>Lutèce v2.0 - Oyapok</title>\r\n<creator>Mairie de Paris</creator>\r\n<subject>lutece;portal;xml;java</subject>\r\n<description>Lutèce v2.0 - Oyapok</description>\r\n<publisher>Mairie de Paris</publisher>\r\n<format>text/html</format>\r\n<language>fr</language>\r\n<rights>Copyrights (c) Mairie de Paris</rights>\r\n</metadata>\r\n',1,1,0,0,0);
