 (61,'shortarticle','2006-10-16 16:52:23','2006-11-07 12:06:03','Plugin XmlPage',4,3,'<shortarticle>\r\n<document-title>Plugin XmlPage</document-title>\r\n<document-summary>Le nouveau plugin XmlPage est inclu dans la distribution de Lutèce - Oyapok. Il s\'agit d\'un plugin permettant d\'afficher sous la forme d\'une xpage ou d\'un portlet le contenu d\'un fichier xml</document-summary>\r\n</shortarticle>\r\n','<shortarticle>\r\n<document-title>Plugin XmlPage</document-title>\r\n<document-summary>Le nouveau plugin XmlPage est inclu dans la distribution de Lutèce - Oyapok. Il s\'agit d\'un plugin permettant d\'afficher sous la forme d\'une xpage ou d\'un portlet le contenu d\'un fichier xml</document-summary>\r\n</shortarticle>\r\n','Le nouveau plugin XmlPage est inclu dans la distribution de Lutèce - Oyapok. Il s\'agit d\'un plugin permettant d\'afficher sous la forme d\'une xpage ou d\'un portlet le contenu d\'un fichier xml','',NULL,NULL,NULL,1,0,0,0,0);
