 (56,9,'Sortie de la pré-version de Lutèce v2','',''),
 (56,11,'','application/octet-stream',''),
 (56,12,'Bienvenue sur ce site démonstration. Il s\'agit d\'une pré-version de Lutèce v2.0. Ce n\'est donc pas la version définitive, ni même une version béta. Elle ne doit en aucun cas être utilisée en production. La version finale dont le nom de code est \"Oyapok\" est prévue au mois d\'octobre 2006. Les premières versions béta seront disponibles à partir de cet été. Voici les nouveautés de cette version majeure : - Une nouvelle gestion documentaire basée sur un modèle de document entièrement dynamique à l\'instar d\'outils tels que ezPublish. Les documents sont gérés dans des espaces à la manière d\'outils tels que Alfresco. Un workflow et un moteur de règles permettent de définir très simplement différents scénarios de circuits de validation et de publication. Cette gestion permet d\'intégrer dans le même modèle plusieurs plugins de la version 1.0 : article, bibliothèque multimédia, fichiers en téléchargement, acteurs locaux... - Une nouvelle gestion centrale des droits/rôles/permissions permet de contrôler l\'accès à l\'ensemble des ressources du portail. Basée sur le modèle RBAC (Role Based Access Control), elle permet de répartir l\'administration du site de manière cloisonnée sur plusieurs équipes. Les ressources concernées par ce dispositif sont aussi celles du noyau (pages, portlet, ...) que celles des plugins (documents, agenda, fils RSS, ...). L\'une des premières applications de cette fonctionnalités est la réalisation d\'espaces collaboratifs sur la même instance de Lutèce dont la gestion pourra se faire de manière entièrement étanche entre espaces. - L\'authentification du backoffice est désormais modulaire pour permettre un contrôle à partir d\'un annuaire LDAP ou tout autre dispositif externe. Au niveau technique, cette version de Lutèce s\'appuie sur de nouvelles briques Open Source éprouvées : - Le moteur de templates Freemarker a été intégré. Il permet de simplifier l\'écriture des templates et apporte de nombreuses fonctionnalités puissantes pour la réalisation des fonctions d\'administration du backoffice. A cette occasion, le code des templates a été épuré en se basant exclusivement sur des styles CSS2 et sur la syntaxe XHTML. La taille des templates entre la v2.0 et la v1.0 a été réduite de 40% tout en offrant plus de confort pour l\'utilisateur. Le code final sera 100% compatible XHTML. Freemarker\'s Logo - Le gestion de cache EHCACHE a également été intégrée. Elle permet de disposer d\'un cache persistent et distribué. Le cache volatile de la version 1.0 pouvait constituer un problème au redémarrage d\'un site ayant plusieurs milliers de pages et un fort de traffic comme Paris.fr. EHCACHE\'s Logo Enfin dernière nouveauté et non des moindres, la version 2.0 gère entièrement l\'internationalisation par le biais des mécanismes standards Java (ResourceBundle, MessageFormat, ...). Par défaut, les languages anglais et français seront disponibles et maintenus par l\'équipe de Lutèce, mais d\'autres pourront être facilement proposés par d\'autres contributeurs. Cette nouvelle version de Lutèce constitue une évolution majeure de l\'outil. Elle intègre 5 années d\'expérience sur l\'exploitation de plus d\'une centaine d\'instances de Lutèce utilisées en interne et plus 3 ans de travail sur la refonte techique de Paris.fr. Son nouveau socle technique, à la fois simple, robuste et éprouvé, respecte les derniers standards tout en assurant une prise en main et une maintenabilité à la portée de tous. L\'équipe de Lutèce est donc très fière de vous présenter cette pré-version 2.0 et espère qu\'elle vous séduira dans l\'attente de la version finale d\'Oyapok. ','',''),
 (56,1,'Lutève v2 en version alpha !','','');
