 (58,11,'','application/octet-stream',''),
 (58,12,'La version 2.0 de Lutèce intègre les nouveautés suivantes :\r\n<br />\r\n<br />\r\n<p>- Une nouvelle gestion documentaire basée sur un <strong>modèle de document entièrement dynamique</strong> à l\'instar d\'outils tels que <em>ezPublish</em>. Les documents sont gérés dans des espaces à la manière d\'outils tels que <em>Alfresco</em>. Un workflow et un moteur de règles permettent de définir très simplement différents scénarios de circuits de validation et de publication. Cette gestion permet d\'intégrer dans le même modèle plusieurs plugins de la version 1.0 : article, bibliothèque multimédia, fichiers en téléchargement, acteurs locaux...\r\n  <br />\r\n</p>\r\n<p>- Une nouvelle <strong>gestion centrale des droits/rôles/permissions</strong> permet de contrôler l\'accès à l\'ensemble des ressources du portail. Basée sur le modèle RBAC (Role Based Access Control), elle permet de répartir l\'administration du site de manière cloisonnée sur plusieurs équipes. Les ressources concernées par ce dispositif sont aussi celles du noyau (pages, portlet, ...) que celles des plugins (documents, agenda, fils RSS, ...). L\'une des premières applications de cette fonctionnalités est la réalisation d\'espaces collaboratifs sur la même instance de Lutèce dont la gestion pourra se faire de manière entièrement étanche entre espaces.\r\n</p>\r\n<p>- L\'authentification du backoffice est désormais modulaire pour permettre un contrôle à partir d\'un annuaire LDAP ou tout autre dispositif externe.\r\n</p>\r\n<p>Au niveau technique, cette version de Lutèce s\'appuie sur de nouvelles briques Open Source éprouvées :\r\n</p>\r\n<p>- Le moteur de templates <strong>Freemarker</strong> a été intégré. Il permet de simplifier l\'écriture des templates et apporte de nombreuses fonctionnalités puissantes pour la réalisation des fonctions d\'administration du backoffice. A cette occasion, le code des templates a été épuré en se basant exclusivement sur des styles CSS2 et sur la syntaxe XHTML. La taille des templates entre la v2.0 et la v1.0 a été réduite de 40% tout en offrant plus de confort pour l\'utilisateur. Le <strong>code final sera 100% compatible XHTML</strong>.\r\n</p>\r\n<p align=\"center\"><a href=\"http://freemarker.org/\">\r\n  <img src=\"http://fr.lutece.paris.fr/fr/images/local/data/library/freemarker.png\" alt=\"freemarker\" align=\"bottom\" border=\"0\" />\r\n  <br /> </a>\r\n</p>\r\n<p>- La <strong>gestion de cache EHCACHE</strong> a également été intégrée. Elle permet de disposer d\'un cache persistent et distribué. Le cache volatile de la version 1.0 pouvait constituer un problème au redémarrage d\'un site ayant plusieurs milliers de pages et un fort de traffic comme Paris.fr.\r\n</p>\r\n<p align=\"center\"><a href=\"http://ehcache.sourceforge.net/\">\r\n  <img src=\"http://fr.lutece.paris.fr/fr/images/local/data/library/ehcache.gif\" alt=\"ehcache\" align=\"bottom\" border=\"0\" /></a>\r\n</p>\r\n<p>- Intégration de <strong>Spring</strong> pour permettre notamment l\'injection des classes DAO de l\'application : possibilité de substituer les classes d\'accès aux données par de nouvelles en cas d\'utilisation d\'une base de données autre que Mysql\r\n</p>\r\n<p align=\"center\"><a target=\"_blank\" href=\"http://www.springframework.org/\">\r\n  <img src=\"http://fr.lutece.paris.fr/fr/images/local/data/library/spring2.png\" alt=\"spring\" align=\"bottom\" border=\"0\" /></a>\r\n</p> Enfin dernière nouveauté et non des moindres, la version 2.0 gère entièrement l\'<strong>internationalisation</strong> par le biais des mécanismes standards Java (ResourceBundle, MessageFormat, ...). Par défaut, les languages anglais et français seront disponibles et maintenus par l\'équipe de Lutèce, mais d\'autres pourront être facilement proposés par d\'autres contributeurs (gestion de l\'encoding UTF-8). Cette nouvelle version de Lutèce constitue une évolution majeure de l\'outil. Elle intègre 5 années d\'expérience sur l\'exploitation de plus d\'une centaine d\'instances de Lutèce utilisées en interne et plus 3 ans de travail sur la refonte techique de Paris.fr. Son nouveau socle technique, à la fois simple, robuste et éprouvé, respecte les derniers standards tout en assurant une prise en main et une maintenabilité à la portée de tous.&nbsp; ','',NULL),
 (60,43,'','image/png',);
